import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import './App.css';
import MazeGame from '../src/shared/MazeGame';
import NavBar from '../src/shared/NavBar';

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <Routes>
          {/* <Route path="/quotes" element={/* Quotes page component goes here */} /> */}
          <Route path="/" element={<MazeGame />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
